nav {
  height: 110px;
  width: 100%;
  background: #282827;
  display: flex;
  flex-direction: row;
}

.background__header {
  width: 100%;
  height: 980px;
  left: 0px;
  top: 0px;
  z-index: -5;
  background: #282827;
}

#menu__logo_img-hidden {
  display: none;
}

#menu__icon-hidden {
  display: none;
}

.menu {
  font-style: normal;
  font-weight: 400;
  font-size: 14px;
  line-height: 19px;
  display: flex;
  justify-content: center;
  padding: 46px 0px 45px 0px;
  margin-left: 310px;
  list-style-type: none;
}
.menu__contacts_phone {
  display: block;
  margin-top: 43px;
  margin-left: 55px;
  font-style: normal;
  font-weight: 700;
  font-size: 18px;
  line-height: 25px;
  text-align: right;
  color: #E3E3E2;
  width: 157px;
}
.menu__contacts_phone a {
  text-decoration: none;
}
.menu__contacts_phone:hover {
  color: #CB4544;
}
.menu__contacts a {
  text-decoration: none;
}
.menu__hr-under {
  width: 1440px;
  height: 2px;
  border: none;
  background: #40403D;
  transform: matrix(1, 0, 0, -1, 0, 0);
}
.menu__logo_img {
  margin-top: 37px;
  width: 164px;
  height: 36px;
}
.menu__icon {
  margin-top: 44px;
  margin-left: 20px;
  width: 26px;
  height: 22px;
}
.menu__icon_fill:hover svg path {
  fill: #CB4544;
}
.menu__hr {
  margin-top: 20px;
  margin-left: 40px;
  width: 2px;
  height: 70px;
  background: #40403D;
  border: none;
}
.menu a {
  text-decoration: none;
}
.menu a:hover {
  color: #999;
}
.menu_link {
  font-style: normal;
  font-weight: 400;
  font-size: 14px;
  line-height: 19px;
  color: #E3E3E2;
}
.menu_item {
  padding-left: 60px;
}
.menu_item:first-child {
  padding-left: 0px;
}

.hamburger {
  display: none;
  margin-left: 42px;
  margin-top: 36px;
  right: 30px;
  height: 60%;
  cursor: pointer;
}
.hamburger:hover .hamburger__hover {
  background-color: #CB4544;
}
.hamburger::before {
  content: "";
  display: block;
  position: absolute;
  width: 2px;
  height: 70px;
  transform: translate(-21px, -16px);
  background-color: #40403D;
}
.hamburger__hover {
  display: block;
  background-color: #E3E3E2;
  width: 30px;
  height: 3px;
  margin-top: 8px;
}

.hiddenmenu {
  position: fixed;
  top: 0;
  left: -100%;
  width: 100%;
  height: 100vh;
  z-index: 10;
  visibility: hidden;
  opacity: 0;
  transition: all 0.6s;
}
.hiddenmenu.active {
  left: 0;
  visibility: visible;
  opacity: 1;
}
.hiddenmenu__block {
  position: relative;
  transition: all 0.6s;
  width: 345px;
  background-color: rgb(0, 0, 0);
  height: 100%;
  padding-top: 140px;
  padding-left: 40px;
  z-index: 10;
}
.hiddenmenu__close {
  position: absolute;
  top: 25px;
  right: 25px;
  cursor: pointer;
}
.hiddenmenu__close:hover {
  color: #CB4544;
}
.hiddenmenu__list {
  list-style-type: none;
  padding-left: 35px;
}
.hiddenmenu__link {
  position: relative;
  text-align: left;
  font-size: 30px;
  margin-bottom: 15px;
}
.hiddenmenu__link::before {
  content: "";
  position: absolute;
  left: -35px;
  top: 12px;
  width: 15px;
  height: 15px;
  border-radius: 100%;
  border: 1px solid #E5E5E5;
  transition: all 0.6s;
}
.hiddenmenu__link:hover::before {
  background-color: #E5E5E5;
}
.hiddenmenu__link a {
  text-decoration: none;
  color: #E5E5E5;
}
.hiddenmenu__link a:hover {
  color: #CB4544;
}
.hiddenmenu__sotial {
  position: absolute;
  width: 90px;
  left: 50%;
  transform: translate(-50%);
  bottom: 50px;
  display: flex;
  justify-content: space-between;
  align-items: center;
}
.hiddenmenu__sotial_link:hover svg path {
  fill: #CB4544;
}
.hiddenmenu__overlay {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: #E5E5E5;
  opacity: 0.75;
  z-index: 9;
}

