nav {
  height: 110px;
  width: 100%;
  background: $background-eternity;
  display: flex;
  flex-direction: row;


}

.background__header {
  //   position: absolute;
  width: 100%;
  height: 980px;
  left: 0px;
  top: 0px;
  z-index: -5;
  background: $background-eternity;
}

#menu__logo_img-hidden {
  display: none;
}

#menu__icon-hidden {
  display: none;
}

.menu {


  font-style: normal;
  font-weight: 400;
  font-size: 14px;
  line-height: 19px;
  display: flex;
  justify-content: center;
  padding: 46px 0px 45px 0px;
  margin-left: 310px;
  list-style-type: none;



  &__contacts {
    &_phone {
      display: block;
      margin-top: 43px;
      margin-left: 55px;
      font-style: normal;
      font-weight: 700;
      font-size: 18px;
      line-height: 25px;
      text-align: right;
      color: $ambience-white;
      width: 157px;

      a {
        text-decoration: none;

      }

      &:hover {
        color: $holland-red;
      }
    }

    a {
      text-decoration: none;

    }
  }

  &__hr-under {
    width: 1440px;
    height: 2px;
    border: none;
    background: $balsamic-reduction;
    transform: matrix(1, 0, 0, -1, 0, 0);
  }

  &__logo_img {
    margin-top: 37px;
    width: 164px;
    height: 36px;




  }

  &__icon {
    margin-top: 44px;
    margin-left: 20px;
    width: 26px;
    height: 22px;

    &_fill:hover {
      svg path {

        fill: $holland-red;
      }
    }
  }

  &__hr {
    margin-top: 20px;
    margin-left: 40px;
    width: 2px;
    height: 70px;
    background: $balsamic-reduction;
    border: none;
  }

  a {
    text-decoration: none;

    &:hover {
      color: #999;
    }


  }

  &_link {
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 19px;
    color: $ambience-white;
  }

  &_item {
    padding-left: 60px;

    &:first-child {
      padding-left: 0px;
    }
  }



}

.hamburger {
  display: none;
  margin-left: 42px;
  margin-top: 36px;
  right: 30px;
  // height: 21px;
  height: 60%;
  cursor: pointer;

  &:hover {
    .hamburger__hover {
      background-color: $holland-red;
    }
  }

  &::before {
    content: "";
    display: block;
    position: absolute;
    width: 2px;
    height: 70px;
    transform: translate(-21px, -16px);
    background-color: $balsamic-reduction
  }



  &__hover {
    display: block;
    background-color: $ambience-white;
    width: 30px;
    height: 3px;
    margin-top: 8px;
  }


}


.hiddenmenu {
  position: fixed;
  top: 0;
  left: -100%;
  width: 100%;
  height: 100vh;
  z-index: 10;
  visibility: hidden;
  opacity: 0;
  transition: all 0.6s;

  // left: 0;
  // visibility: visible;
  // opacity: 1;
  &.active {
    left: 0;
    visibility: visible;
    opacity: 1;

  }

  &__block {
    position: relative;
    transition: all 0.6s;
    width: 345px;
    background-color: $hidden-menu;
    height: 100%;
    padding-top: 140px;
    padding-left: 40px;
    z-index: 10;
  }

  &__close {
    position: absolute;
    top: 25px;
    right: 25px;
    cursor: pointer;

    &:hover {
      color: $holland-red;
    }

    // background-color: $hidden-menu-text;
  }

  &__list {
    list-style-type: none;
    padding-left: 35px;
  }

  &__link {
    position: relative;
    text-align: left;
    font-size: 30px;
    margin-bottom: 15px;

    &::before {
      content: '';
      position: absolute;
      left: -35px;
      top: 12px;
      width: 15px;
      height: 15px;
      border-radius: 100%;
      border: 1px solid $hidden-menu-text;
      transition: all 0.6s;
    }

    &:hover {
      &::before {
        background-color: $hidden-menu-text;
      }
    }

    a {
      text-decoration: none;
      color: $hidden-menu-text;

      &:hover {
        color: $hidden-menu-hover;
      }
    }
  }

  &__sotial {
    position: absolute;
    width: 90px;
    left: 50%;
    transform: translate(-50%);
    bottom: 50px;
    display: flex;
    justify-content: space-between;
    align-items: center;

    &_link {
      &:hover {
        svg path {
          fill: $hidden-menu-hover;
        }
      }
    }
  }

  &__overlay {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: $hidden-menu-overlay;
    opacity: 0.75;
    z-index: 9;
  }
}

